func (c *current) onAnnotatedDecl1(docstring, decl any) (any, error) {
	switch node := decl.(type) {
	case *InterfaceDecl:
		node.DocString = docstring.(string)
		return node, nil
	case *EnumDecl:
		node.DocString = docstring.(string)
		return node, nil
	case *ScalarDecl:
		node.DocString = docstring.(string)
		return node, nil
	case *ClassDecl:
		node.DocString = docstring.(string)
		return node, nil
	case *SlotDecl:
		node.DocString = docstring.(string)
		return node, nil
	case *DirectiveDecl:
		node.DocString = docstring.(string)
		return node, nil
	default:
		return decl, nil
	}
}

